import React from "react";
import { Link } from "react-router-dom";
import '../assets/style/Games.css'
import { Navbar } from '../components'

type gameType = {
    id: string,
    name: string,
    logo: string,
    info: string
}

export default function Games(){

    const games = [
        {"name": "Secret Hitler", "min": 5, "max": 10, "info": "abcsabd asdasd asdasd asdasda dsad asd asd asd"
            , "logo": "SH", "id":"SH"
        },
        {"name": "Castle Wars", "min": 2, "max": 2, "info": "abcsabd asdasd asdasd asdasda dsad asd asd asd"
            , "logo": "CW", "id":"CW"
        }
    ]

    function gameDiv(game: gameType){
        return <div id={game.id}>
            <div className="logo">
                {game.logo}
            </div>
            <div className="title">
                {game.name}
            </div>
            <div className="info">
                {game.info}
            </div>
        </div>
    }

    return <>
    <Navbar></Navbar>
    <table className="gameslist"><tbody>
        {games.map(game => {
            return gameDiv(game)
        })}
    </tbody></table>        
    </>
}
